public class BOSegmentsSyncControllerTest {
    @Test
    fun checkInitialization() {
        try {
            val currentDaySessionDataModel = BOAppSessionDataModel.fromJsonString(sessionJsonString())
            val currentDaySessionData: HashMap<String, Any>? = null
            val segmentController = BOSegmentsSyncController.getInstance()
            val segmentEvents = prepareSegments()
            for (indx in segmentEvents!!.segments.indices) {
                val oneSegment = segmentEvents.segments[indx]
                val doesQualify = segmentController.doesUserQualifiesForSegment(oneSegment, currentDaySessionDataModel, object : BOHandlerMessage() {
                    override fun handleMessage(msg: BOMessage) {
                        if (msg.what == 1) {
                            Assert.assertTrue("", Boolean.parseBoolean("" + msg.what))
                        } else {
                            Assert.assertFalse("", Boolean.parseBoolean("" + msg.what))
                        }
                    }
                })
            }
        } catch (e: IOException) {
            e.printStackTrace()
        }
    }

    fun prepareSegments(): BOSegmentEvents? {
        val segmentMap: HashMap<String, Any>? = BOCommonUtils.getHashmapFromJsonString(segmentJsonString())
        return BOSegmentEvents.fromJsonDictionary(segmentMap)
